const DraggableItem = () => {
  const onDragStart = (e) => {
    e.dataTransfer.setData('text/plain', e.target.id);
    e.currentTarget.classList.add('dragging');
  };

  const onDragEnd = (e) => {
    e.currentTarget.classList.remove('dragging');
  };

  return (
    <div
      draggable="true"
      onDragStart={onDragStart}
      onDragEnd={onDragEnd}
      className="draggable-item"
    >
      可拖动元素
    </div>
  );
};`})})]})]}),v("section",{id:"transitions",className:"section",children:[l("h2",{className:"section-title",children:"3. 动效与转场"}),v("div",{className:"subsection",children:[l("h3",{className:"subsection-title",children:"3.1 动效原则"}),l("p",{children:"动效应当有目的地增强用户体验，而非仅作装饰："}),v("ul",{children:[v("li",{children:[l("strong",{children:"目的性"}),"：每个动效都应该传达含义，引导注意力或提供反馈"]}),v("li",{children:[l("strong",{children:"自然流畅"}),"：动效应当模拟现实世界物理特性，如惯性、弹性"]}),v("li",{children:[l("strong",{children:"简洁克制"}),"：避免过度动画，导致视觉疲劳或干扰任务完成"]}),v("li",{children:[l("strong",{children:"一致性"}),"：相似元素应有相似的动效语言"]}),v("li",{children:[l("strong",{children:"性能优先"}),"：动效不应导致界面卡顿或延迟响应"]})]})]}),v("div",{className:"subsection",children:[l("h3",{className:"subsection-title",children:"3.2 标准动效库"}),l("div",{className:"table-container",children:v("table",{children:[l("thead",{children:v("tr",{children:[l("th",{children:"动效类型"}),l("th",{children:"持续时间"}),l("th",{children:"缓动函数"}),l("th",{children:"使用场景"})]})}),v("tbody",{children:[v("tr",{children:[l("td",{children:"淡入/淡出"}),l("td",{children:"200-300ms"}),l("td",{children:"ease-in-out"}),l("td",{children:"元素出现与消失"})]}),v("tr",{children:[l("td",{children:"缩放"}),l("td",{children:"200-400ms"}),l("td",{children:"cubic-bezier(0.175, 0.885, 0.32, 1.275)"}),l("td",{children:"强调元素、模态框"})]}),v("tr",{children:[l("td",{children:"滑动"}),l("td",{children:"300-500ms"}),l("td",{children:"ease-out"}),l("td",{children:"页面转场、侧边栏"})]}),v("tr",{children:[l("td",{children:"弹跳"}),l("td",{children:"600-800ms"}),l("td",{children:"cubic-bezier(.17,.67,.83,.67)"}),l("td",{children:"通知、提示信息"})]}),v("tr",{children:[l("td",{children:"变换"}),l("td",{children:"300-500ms"}),l("td",{children:"ease-in-out"}),l("td",{children:"状态变化、数据更新"})]})]})]})}),l("div",{className:"code-block",children:l("pre",{children:`/* 标准动效CSS变量 */
